import React from 'react'
import Tdata from './Tdata'

const Allitem = () => {
  return (
    <>
       <section className='Testimonial mtop'>
        <div className='container grid1'>
            {Tdata}
        </div>
       </section>
    </>
  )
}

export default Allitem
